import React from "react";

import Timeline from "../elements/Timeline";

function Education() {
  return (
    <section className="section" id="education">
      <div className="container">
        <h1 className="title">Education</h1>
        <Timeline />
      </div>
    </section>
  );
}

export default Experience;
